import React from 'react'
import './home.css'

export default function home() {
    return (
        <div className="hero-image">
        <div className="hero-text">
          <h1 style="font-size:50px">I am Jane Doe</h1>
          <h3>And I'm a Photographer</h3>
          <button>Hire me</button>
        </div>
      </div>

    )
}
